@tablethotels presents the best treehouse hotels in the world.

Tablet is the official hotel selection of the Michelin Guide, and today they're looking at a type of accommodation that combines the adventurousness of your childhood with all the detail and professionalism you expect from a luxury boutique hotel. They get you up amongst the leaves and into the gentle embrace of nature — a pleasure greater than knowing the secret knock. 

Tablet is your source for discovering the world’s most exciting places to stay.

